      .then((res) => res.json())
      .then((date) => {
        setPeople(date.results)
        console.log(date.results)

      })
  }, [])
  const Dalete = man => {
    setPeople(people.filter(a => a !== man))
  }
  return <div>
    {
      people.map(elm => {
        return <div key={elm.phone}>
          <h3>{elm.name.first}{elm.name.last}{<img src={elm.picture.large} />}{elm.registered.age} <button onClick={() => Dalete(elm)}>Dalete</button></h3>
        </div>
      })
    }
  </div>
}
